import React, { useState, useEffect } from "react";

function Home() {
  {
    document.title = "Phone Phlinger | Home";
    document.getElementsByTagName("META")[3].content =
      "This is the meta for the home page!";
  }
  const [something, setSomething] = useState({ abc: "xyz" }); // just a quick reminder for state
  const sendRequest = () => {
    fetch("http://127.0.0.1:5000/test", {
      cache: "no-cache",
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      something: JSON.stringify(something),
    })
      .then((response) => response.json().then(setSomething(response)))
      .catch((error) => console.log(error));
  };

  return (
    <div>
      <h1>This is the Home Page!</h1>
      <button onClick={sendRequest}>click me to do something!</button>
      <h2>{something}</h2>
    </div>
  );
}

export default Home;
